[mod-setting-description]
rampant--unitsAffectedByTiles=(Может вызвать рассинхрон) На юнитов действуют модификаторы передвижения тайлов
rampant--oldRedEnemyMapColor=Возвращает цвет врагов на карте к цвету в оригинальной игре
rampant--unitSpawnerBreath=Теперь породители юнитов дышат воздухом, так что на них влияют вещи типа ядовитых капсул
rampant--useDumbProjectiles=Использовать снаряды атакующих, которые блокируются (стенами). Это полезно отметить, если вы используете новых врагов.
rampant--attackWaveGenerationThresholdMax=Общее количество очков, которое должен набрать чанк, чтобы возникла волна атаки. НЕ влияет на обычные волны кусак. Линейно масштабируется с коэффициентом эволюции (начальный порог при эволюции 0,0)
rampant--attackWaveGenerationThresholdMin=Общее количество очков, которое должен набрать чанк, чтобы возникла волна атаки. НЕ влияет на обычные волны кусак. Линейно масштабируется с коэффициентом эволюции (конечный порог при эволюции 100,0)
rampant--attackWaveMaxSize=Если вы хотите изменить зависимость волны атаки от эволюции, отредактируйте файл config.lua в архиве мода.
rampant--maxNumberOfSquads=Больше отрядов требуют больше UPS.
rampant--maxNumberOfBuilders=Больше формирующихся групп требуют больше UPS.
rampant--safeBuildings=Это должно быть включено, чтобы работало безопасное строительство. Это приведет к регенерации объектов, с флагом разрушаемости, установленным в false, что заставит их больше никогда не быть целью или повреждёнными.
rampant--safeBuildings-curvedRail=Обезопасить изогнутые рельсы от кусак
rampant--safeBuildings-straightRail=Обезопасить прямые рельсы от кусак
rampant--safeBuildings-bigElectricPole=Обезопасить большие опоры ЛЭП от кусак
rampant--safeBuildings-railChainSignals=Обезопасить проходные светофоры от кусак
rampant--safeBuildings-railSignals=Обезопасить светофоры от кусак
rampant--safeBuildings-trainStops=Обезопасить ЖД-станции от кусак
rampant--permanentNocturnal=Переключение этого параметра вызовет появление волн атак мода Rampant ночью. Работает лучше с модом Clockwork или другими модами, расширяющими ночь.
rampant--aiPointsScaler=От 0.0 до 100.0. Уровень определяет, сколько очков действия получает ИИ каждый логический цикл для совершения действий, например, создания атакующих волн. 0.3 - очень легко, 0.75 - легко, 1.0 - средне, 1.25+ - тяжело.
rampant--addWallResistanceAcid=При включении стены получат 60% сопротивления кислоте, что уменьшит повреждения от атак плевак.
rampant--safeBuildings-lamps=Обезопасить лампы от кусак
rampant--removeBloodParticles=Брызги крови, которые появляются при убийстве кусак, вызывают падение UPS.
rampant--attack-warning=Показывать сообщение, предупреждающее игроков о надвигающейся волне атаки
rampant--enableSwarm=Этот параметр уменьшает размер элемента collision_mask, что позволяет кусакам уменьшить количество столкновений и двигаться более плавной волной
rampant--newEnemies=Добавляет новых врагов, которые будут распространены по миру. Это увеличивает потребление ОЗУ. По 1 варианту на кусак, червей, гнёзд и 5 уровней их развития это увеличит потребление ОЗУ на 2 ГБ. По 20 вариантов и 10 уровней развития  - до 9 ГБ потребления ОЗУ. Варианты добавляют случайности каждому уровню кусак, червей и гнёзд.
rampant--enemySeed=Зерно случайной генерации всех юнитов, измените, если хотите поменять характеристики врагов
rampant--deadZoneFrequency=Процент зон, которые генерируются без червей или гнёзд
rampant--newEnemyVariations=Число определяет количество вариантов на каждый уровень развития. Это добавляет случайности каждому уровню развития. От 1 до 20.
rampant--disallowFriendlyFire=Не позволяет вражеским плевакам и червям наносить урон юнитам или зданиям от одной и той же силы за счет урона по области.
rampant--tierStart=Это начальный уровень врага, который будет использоваться при создании набора врагов для указанного количества уровней и линейно увеличивается до конечного уровня. Примерно по здоровью каждый уровень выглядит следующим образом (1-15,2-75,3-150,4-250,5-1000,6-2000,7-3500,8-7500,9-15000,10-30000). Значение от 1 до 10.
rampant--tierEnd=Это конечный уровень врага, который будет использоваться при создании набора врагов для указанного количества уровней и линейно увеличивается до конечного уровня. Примерно по здоровью каждый уровень выглядит следующим образом (1-15,2-75,3-150,4-250,5-1000,6-2000,7-3500,8-7500,9-15000,10-30000). Значение от 1 до 10.
rampant--enableMigration=Это позволит ИИ расселяться червям и гнёздам. Смотрите настройки карты для настройки расселения кусак.
# rampant--liteMode=ИИ по-прежнему полностью функционален, но сканирование и обработка карты замедляются, что приводит к тому, что феромоны остаются дольше, уменьшают количество порождаемых атак, а феромоны распространяются медленнее.
rampant--attackWaveGenerationUsePlayerProximity=Включает количество феромонов игрока в пороговое значение к чанкам с гнездами кусак, которые будут генерировать атаки Rampant. НЕ влияет на ванильные волны атаки.
rampant--attackPlayerThreshold=Результат, которого должен достичь чанк, чтобы внести свой вклад в порог атаки. Увеличение снижает влияние феромонного облака игрока.
rampant--unkillableLogisticRobots=Это делает транспортных дронов невосприимчивыми к повреждениям
rampant--unkillableConstructionRobots=Это делает строительных дронов невосприимчивыми к повреждениям
rampant--unitBiterHealthScaler=Уровень здоровья кусак в процентах
rampant--unitBiterSpeedScaler=Уровень скорости кусак в процентах
rampant--unitBiterDamageScaler=Уровень урона кусак в процентах
rampant--unitBiterRangeScaler=Уровень дальности атаки кусак в процентах
rampant--unitBiterHealingScaler=Уровень регенерации кусак в процентах
rampant--unitSpitterHealthScaler=Уровень здоровья плевак в процентах
rampant--unitSpitterSpeedScaler=Уровень скорости плевак в процентах
rampant--unitSpitterDamageScaler=Уровень урона плевак в процентах
rampant--unitSpitterRangeScaler=Уровень дальности атаки плевак в процентах
rampant--unitSpitterHealingScaler=Уровень регенерации плевак в процентах
rampant--unitDroneHealthScaler=Уровень здоровья дронов в процентах. Дроны исходят от фракций Породитель и Оса.
rampant--unitDroneSpeedScaler=Уровень скорости дронов в процентах. Дроны исходят от фракций Породитель и Оса.
rampant--unitDroneDamageScaler=Уровень урона дронов в процентах. Дроны исходят от фракций Породитель и Оса.
rampant--unitDroneRangeScaler=Уровень дальности атаки дронов в процентах. Дроны исходят от фракций Породитель и Оса.
rampant--unitDroneHealingScaler=Уровень регенерации дронов в процентах. Дроны исходят от фракций Породитель и Оса.
rampant--unitWormHealthScaler=Уровень здоровья червей в процентах
rampant--unitWormDamageScaler=Уровень урона червей в процентах
rampant--unitWormRangeScaler=Уровень дальности атаки червей в процентах
rampant--unitWormHealingScaler=Уровень регенерации червей в процентах
rampant--unitSpawnerHealthScaler=Уровень здоровья породителей в процентах
rampant--unitSpawnerOwnedScaler=Максимальное количество порождений, которые может создать породитель, в процентах
rampant--unitSpawnerSpawnScaler=Максимальное количество порождений, которые может создать породитель за один раз, в процентах
rampant--unitSpawnerRespawnScaler=Сколько времени проходит между появлениями новых порождений, в процентах
rampant--unitSpawnerHealingScaler=Уровень регенерации породителей в процентах
rampant--unitHiveHealthScaler=Уровень здоровья ульев в процентах
rampant--unitHiveHealingScaler=Уровень регенерации ульев в процентах
rampant--unitHiveRespawnScaler=Сколько времени проходит между появлениями новых юнитов из ульев, в процентах
# rampant--suppress-surface-change-warnings=Отключить все предупреждения, появляющиеся при смене поверхности (игрового мира), сообщения появятся только при первом появлении в мире.
# rampant--aiAggressiveness=Этот параметр напрямую влияет на то, как часто ИИ переходит в мирное состояние. Меньше единицы заставит кусающих быть более агрессивными, больше единицы - более миролюбивые. Установка этого значения на ноль приведет к тому, что ИИ никогда не будет в покое. Диапазон от 0 до 2.
rampant--enableShrinkNestsAndWorms=Уменьшает размер границ столкновения у гнёзд и червей на 50% (для лучшего прохождения между ними). Могут возникнуть взаимные перекрытия из-за того, что размер границ столкновения будет меньше, чем размер самого объекта.
rampant--raidAIToggle=Включает рейды ИИ из-за пределов облака загрязнения
rampant--siegeAIToggle=Включает осадные группы ИИ из-за пределов облака загрязнения, которые будут атаковать или гнездиться
# rampant--onslaughtAIToggle=Включает режим агрессивного нападения, ИИ получает в 2 раза больше очков действия на логический цикл
rampant--laserEnemy=Фракция лазерных кусак, большое сопротивление лазеру, небольшое - электричеству. Юниты: кусаки и плеваки.
rampant--waspEnemy=Фракция ос, юниты - только плеваки, плюющиеся мелкими дронами.
rampant--spawnerEnemy=Фракция породителей, юниты - плеваки, появляющиеся из породителей, плеваки откладывают яйца, из которых вылупляются кусаки.
rampant--trollEnemy=Фракция регенерирующих кусак, мощная регенерация, большая уязвимость к огню, небольшое сопротивление физическим атакам, небольшое сопротивление взрывчатке.
rampant--fastEnemy=Фракция быстрых кусак, большая скорость передвижения, небольшое сопротивление взрывчатке.
rampant--infernoEnemy=Фракция адских кусак, юниты - только плеваки, которые плюются зажигательной кислотой, сжигающей всё. Большое сопротивление кислоте и огню, небольшая уязвимость к яду.
rampant--nuclearEnemy=Фракция ядерных кусак, юниты - только кусаки, взрывающиеся как атомная бомба. Большая уязвимость к взрывчатке.
rampant--electricEnemy=Фракция электрических кусак, юниты - только кусаки, на небольшом расстоянии поражающие электричеством несколько целей на линии удара. Большое сопротивление электричеству, небольшое сопротивление лазеру.
rampant--fireEnemy=Фракция огненных кусак, большое сопротивление кислоте и огню.
rampant--suicideEnemy=Фракция кусак-самоубийц, юниты - только кусаки, взрывающиеся при атаке. Небольшое сопротивление яду, большая уязвимость ко взрывчатке,
rampant--physicalEnemy=Фракция жестоких кусак, юниты - только кусаки. Большое сопротивление физическим атакам и взрывчатке, небольшая уязвимость к электричеству.
rampant--acidEnemy=Фракция кислотных кусак, большое сопротивление кислоте, небольшое сопротивление яду.
rampant--energyThiefEnemy=Фракция кусак-сапёров, большое сопротивление электричеству, небольшое сопротивление лазеру. Разрушают подключенные структуры, создавая энергопоглощающие кристаллы.
rampant--poisonEnemy=Фракция ядовитых кусак, юниты - только кусаки. При смерти создаёт облако, которое лечит кусак и повреждает объекты игрока. Большое сопротивление яду, небольшая уязвимость к электричеству, взрывчатке и лазеру, небольшое сопротивление огню.
rampant--disableCollidingProjectiles=Снаряды (плевки) кусак не сталкиваются с другими кусаками, червями или гнёздами. Всё остальное может с ними сталкиваться.
rampant--enableFullMapScan=Этот параметр заставляет карту игры медленно сканироваться на предмет сущностей, созданных или уничтоженных вне системы событий factorio. (Если в моде не используется script_raised_built или script_raised_destroyed, это приведет к тому, что Rampant в конечном итоге будет соответствовать карте игры).
rampant--unitAndSpawnerFadeTime=Время в секундах, которое трупы кусак будут оставаться вокруг
rampant--enableFadeTime=Включить время исчезновения для уменьшения или увеличения кусак, плевак, червей, гнёзд и ульев. Если отключено, время существования трупов не изменится.
rampant--temperamentRateModifier=Как быстро Rampant достигнет пика темперамента ИИ, который контролирует атаки и распространение. Коэффициент процентный, т.е. 1 = 100%

[description]
rampant-bobs-nee-newEnemies=Обнаружены враги из модов Bob и NE вместе с врагами Rampant,\nартефакты из каждого из этих модов будут по-прежнему работать с новыми врагами Rampant.\nГенерация создателей юнитов Bob и NEE не поддерживается Rampant,\nкогда активны новые враги Rampant.
